var title_f14_45_15066="Abnormal placentation in preeclampsia";
var content_f14_45_15066=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F78926&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F78926&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 619px\">",
"   <div class=\"ttl\">",
"    Abnormal placentation in preeclampsia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 599px; height: 558px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Exchange of oxygen, nutrients, and waste products between the fetus and mother depends on adequate placental perfusion by maternal vessels. In normal placental development, invasive cytotrophoblasts of fetal origin invade the maternal spiral arteries, transforming them from small-caliber resistance vessels to high-caliber capacitance vessels capable of providing placental perfusion adequate to sustain the growing fetus. During the process of vascular invasion, the cytotrophoblasts differentiate from an epithelial phenotype to an endothelial phenotype, a process referred to as \"pseudovasculogenesis\" or \"vascular mimicry\" (Upper panel). In preeclampsia, cytotrophoblasts fail to adopt an invasive endothelial phenotype. Instead, invasion of the spiral arteries is shallow and they remain small caliber, resistance vessels (Lower panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lam C, Lim KH, Karumanchi SA. Circulating angiogenic factors in the pathogenesis and prediction of preeclampsia. Hypertension 2005; 46:1077. Copyright &copy; 2005 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
